{'code': '// Sample monthly expenses
const monthlyExpenses = [
  "Kroger Groceries:251", "Uber:39", "Netflix Movie Service:12",
  "Utility Internet:85", "Old Navy Clothing:145", "Lyft:34",
  "Utility Electric:91", "Clothing Outlet:122",
  "Fast Food Restaurant:18", "Shell Fuel:42", "Movie Theater:44",
  "Utility Water:27", "Best Buy Electronics:299", "Apple Store:899",
  "Gas Station:31", "Movie Rental:4", "Amazon:112", "Gas Station:33",
  "Movie Theater:47", "Utility Electric:88", "Clothing Outlet:112",
  "Fast Food Restaurant:21", "Shell Fuel:42", "Movie Theater:44"
];

// Arrays for categories
const clothing = [];        // Contains "Clothing"
const entertainment = [];   // Contains "Movie"
const food = [];            // Contains "Groceries" or "Restaurant"
const fuel = [];            // Contains "Fuel" or "Gas"
const travel = [];          // Contains "Lyft" or "Uber"
const utilities = [];       // Contains "Utility"
const largePurchases = [];  // Amount > 100

// Totals and averages
let totalExpenses = 0;
let averageExpense = 0;

// Loop through each expense
for (const item of monthlyExpenses) {
  const [description, amountStr] = item.split(":");
  const amount = parseFloat(amountStr);
  totalExpenses += amount;

  // Categorize based on description
  if (description.includes("Clothing")) clothing.push(item);
  if (description.includes("Movie")) entertainment.push(item);
  if (description.includes("Groceries") || description.includes("Restaurant")) food.push(item);
  if (description.includes("Fuel") || description.includes("Gas")) fuel.push(item);
  if (description.includes("Lyft") || description.includes("Uber")) travel.push(item);
  if (description.includes("Utility")) utilities.push(item);
  if (amount > 100) largePurchases.push(item);
}

averageExpense = totalExpenses / monthlyExpenses.length;

// Output results
console.log("Total Expenses:", totalExpenses.toFixed(2));
console.log("Average Expense:", averageExpense.toFixed(2));
console.log("\nClothing:", clothing);
console.log("Entertainment:", entertainment);
console.log("Food:", food);
console.log("Fuel:", fuel);
console.log("Travel:", travel);
console.log("Utilities:", utilities);
console.log("Large Purchases:", largePurchases);
'}

