const entertainment = []   // "Movie"
const food = []            // "Groceries" or "Restaurant"
const fuel = []            // "Fuel" or "Gas"
const travel = []          // "Lyft" or "Uber"
const utilities = []       // "Utility"
const largePurchases = []  // Expenses over 100.00

// Totals and averages
let totalExpenses = 0
let averageExpense = 0

// Process each expense
monthlyExpenses.forEach(expense => {
    // Split the expense string to get vendor and amount
    const [vendor, amountStr] = expense.split(':')
    const amount = parseFloat(amountStr)

    // Add to total expenses
    totalExpenses += amount

    // Check for large purchases first (over 100.00)
    if (amount > 100.00) {
        largePurchases.push(amount)
    }

    // Categorize based on vendor name (case-insensitive)
    const vendorLower = vendor.toLowerCase()

    if (vendorLower.includes('clothing')) {
        clothing.push(amount)
    }

    if (vendorLower.includes('movie')) {
        entertainment.push(amount)
    }

    if (vendorLower.includes('groceries') || vendorLower.includes('restaurant')) {
        food.push(amount)
    }

    if (vendorLower.includes('fuel') || vendorLower.includes('gas')) {
        fuel.push(amount)
    }

    if (vendorLower.includes('lyft') || vendorLower.includes('uber')) {
        travel.push(amount)
    }

    if (vendorLower.includes('utility')) {
        utilities.push(amount)
    }
})

// Calculate average expense
